import React from "react";

import {
  RadioGroup,
  FormControl,
  FormLabel,
  Button,
  Radio,
  Sheet,
  Input,
  Box,
  Typography
} from "@mui/joy";

function pageOne({ setQuizStep, quizStep }) {
  const [values, setValues] = useState({

  })
  return (
    <FormControl sx={{ width: "40rem" }}>
      <div className="flex flex-col gap-3">
        <div aria-label="name-question">
          <FormLabel sx={{ fontSize: "1.3em" }}>First Name</FormLabel>
          <Input />
        </div>
        <div className="flex gap-8">
          <div className="flex gap-2">
            <div>
              <FormLabel aria-label="age-question" sx={{ fontSize: "1.3em" }}>
                Age
              </FormLabel>
              <Input
                type="number"
                aria-label="age-question"
                defaultValue={0}
                slotProps={{
                  input: {
                    min: 0,
                    max: 116,
                    step: 1,
                  },
                }}
              />
            </div>
            <div>
              <FormLabel sx={{ fontSize: "1.3em" }}>Weight</FormLabel>
              <Input
                type="number"
                aria-label="weight-question"
                defaultValue={0}
                slotProps={{
                  input: {
                    min: 0,
                    max: 1000,
                    step: 1,
                  },
                }}
                endDecorator={<div>lbs</div>}
              />
            </div>
          </div>
          <div className="flex gap-2">
            <div>
              <FormLabel aria-label="age-question" sx={{ fontSize: "1.3em" }}>
                Height
              </FormLabel>
              <div className="flex">
                <Input
                  type="number"
                  aria-label="height-feet-question"
                  defaultValue={0}
                  endDecorator={<div>ft</div>}
                  slotProps={{
                    input: {
                      min: 0,
                      max: 116,
                      step: 1,
                    },
                  }}
                />
                <div>
                  <Input
                    type="number"
                    aria-label="height-inches-question"
                    defaultValue={0}
                    slotProps={{
                      input: {
                        min: 0,
                        max: 1000,
                        step: 1,
                      },
                    }}
                    endDecorator={<div>in</div>}
                  />
                </div>
              </div>
            </div>
          </div>
        </div>

        <div aria-label="goal-question">
          <FormLabel sx={{ fontSize: "1.3em" }}>What are your goals?</FormLabel>
          <RadioGroup
            aria-labelledby="goal-label"
            defaultValue={null}
            size="lg"
          >
            <div className="flex justify-between text-center">
              {["Lose Weight", "Maintain Weight", "Gain Weight"].map(
                (value) => (
                  <Sheet
                    key={value}
                    sx={{
                      p: 2,
                      borderRadius: "md",
                      boxShadow: "sm",
                      width: "30%",
                    }}
                  >
                    <Radio
                      label={`${value}`}
                      aria-label={`select-${value}`}
                      overlay
                      disableIcon
                      value={value}
                      onClick={() => {
                        localStorage.setItem("goal", value);
                      }}
                    />
                  </Sheet>
                )
              )}
            </div>
          </RadioGroup>
        </div>

        <div aria-label="activity-level-question">
          <FormLabel sx={{ fontSize: "1.3em" }}>What is your level of physical activity?</FormLabel>
          <RadioGroup
            aria-labelledby="goal-label"
            defaultValue={null}
            size="lg"
          >
            <div className="flex justify-between text-center">
              {[{title: "Sedentary", description: "Little or no exercise"}, {title: "Moderately Active", description: "Moderate exercise 3-5 days a week"}, {title: "Very Active", description: "Hard exercise 6-7 days a week"}].map(
                (value) => (
                  <Sheet
                    key={value}
                    sx={{
                      p: 2,
                      borderRadius: "md",
                      boxShadow: "sm",
                      width: "30%",
                    }}
                  >
                    <Radio
                      label={`${value.title}`}
                      aria-label={`select-${value.title}`}
                      overlay
                      disableIcon
                      value={value.title}
                      onClick={() => {
                        localStorage.setItem("goal", value.title + " with " + value.description);
                      }}
                    />
                    <Typography>{value.description}</Typography>
                  </Sheet>
                )
              )}
            </div>
          </RadioGroup>
        </div>

        <div className="w-full flex justify-between">
          <Button
            variant="soft"
            aria-label="previous-page-button"
            onClick={() => {
              setQuizStep(null);
            }}
          >
            Previous
          </Button>
          <Button
            variant="soft"
            aria-label="next-page-button"
            onClick={() => {
              setQuizStep(quizStep + 1);
            }}
          >
            Next
          </Button>
        </div>
      </div>
    </FormControl>
  );
}

export default pageOne;
